import Layout from '../../components/MyLayout';
import fetch from 'isomorphic-unfetch';

const Order = props => (
  <Layout>
    <h1>{props.order.visitor.name}</h1>
    <table class="table">
        <thead>
            <tr>
            <th scope="col">{props.order.oid}</th>
            <th scope="col">{props.order.pid}</th>
            <th scope="col">{props.order.amount}</th>
            <th scope="col">{props.order.vid}</th>
            <th scope="col">{props.order.date}</th>
            <th scope="col">{props.order.vehicle.state}</th>
            <th scope="col">{props.order.vehicle.plate}</th>
            <th scope="col">{props.order.vehicle.type}</th>
            <th scope="col">{props.order.visitor.name}</th>
            <th scope="col">{props.order.visitor.email}</th>
            <th scope="col">{props.order.visitor.payment_info.card}</th>
            <th scope="col">{props.order.visitor.payment_info.name_on_card}</th>
            <th scope="col">{props.order.visitor.payment_info.zip}</th>
            <th scope="col">{props.order.payment_processing.card_transaction_id}</th>
            <th scope="col">{props.order.payment_processing.date_and_time}</th>
            </tr>
        </thead>
        <tbody>
        </tbody>
        </table>
    <ul>

    </ul>
  </Layout>
);

Order.getInitialProps = async function(context) {
  const { id } = context.query;
  const res = await fetch(`http://localhost:8080/parkpay/orders/${id}`);
  const order = await res.json();

  return { order };
};

export default Order;
